This torrent contains the first three volumes of the series as well as five stand-alone single digital copies of individual stories. The first volume is divided into four issues as it was published; the remaining two volumes are the collected editions. The standalone digitals are:

Batman Black and White - A Black and White World 001 (Digital) (ActionComics-DCP)
Batman Black and White - An Innocent Guy 001 (Digital) (ActionComics-DCP)
Batman Black and White - Good Evening, Midnight 001 (Digital) (ActionComics-DCP)	
Batman Black and White - Perpetual Morning 001 (Digital) (ActionComics-DCP)	
Batman Black and White - Two of a Kind 001 (Digital) (ActionComics-DCP)

All issues are the archival editions with no scanner credit, except for those listed above by AC-DCP. Thanks to all the scanners for their efforts; please seed and enjoy.

